import React from "react";
import { Route, Routes, useParams } from "react-router-dom";
import Login from "./component/login/Login";
import Home from "./pages/Home";
import Gallery from "./component/Gallery/Gallery";
import Homeabout from "./component/Home/Homeabout";
import Header from "./component/Header/Header";
import Order from "./component/Order/Order";
import About from "./component/About/About";
import Contact from "./component/Contact/Contact";
import Footer from "./component/Footer/Footer";
import Ragistration from "./component/Ragistration/Ragistration";
const App = () => {
  const { id } = useParams();
  return (
    <>     .
        <div className="loader" id="loader"></div>
        <div className="loader" id="loader2"></div>
        <div className="loader" id="loader3"></div>
        <div className="loader" id="loader4"></div>
        <span id=".loader-text">LOADING...</span><br></br>
        <Header />
        <Routes>
          <Route path="/" Component={Home} />
          <Route path="/login" Component={Login} />
          <Route path="/ragistration" Component={Ragistration} />
          <Route path="/gallery" Component={Gallery} />
          <Route path="/contact" Component={Contact} />
          <Route path="/about" Component={About} />
          <Route path="/order:id" Component={Order} />
        </Routes>
        <Footer />
      </>
        );
}
        export default App;
